import '../App.css';
import styled from 'styled-components'

const Card = styled.div`
  height: 270px;
  margin: 2%;
  padding: 1%;
`;

export default function ProductCard(props) {

  console.log('card', props)
  return (
  <>

  <Card key={props.product.id}>
    <p>{props.product.name}</p>
    <p>{`Farm: ${props.product.farm}`}</p>
  </Card>
  </>
  )
};
